import React from 'react'
import styled from 'styled-components'

import styles from '../styles/styles.module.css'

const Slider = styled.div`
    width: 100%;
    height: 100%;
    position: relative;
    overflow: hidden;
    display: flex;
    align-items: center;
`;

const SliderButton = styled.button`
    width: 50px;
    height: 50px;
    border-radius: 100%;
    text-align: center;
    line-height: 50px;
    z-index: 2;
`;
const Hour = ({text, icon, temp_c, time, convertTime}) => {

    return (
       <Slider>
           <SliderButton> L </SliderButton>
        <div className={styles.hour}>
            <span>{convertTime(time)}</span>
            <img src={icon} alt={text}/>
            <span>{text}</span>
            <span>{temp_c}</span>
        </div>
        <SliderButton> R </SliderButton>
       </Slider>
    )
}

export default Hour
